#!/bin/bash

#################################################################################################################
# Name:                       et_it_product_info.sh
# Purpose:                    This creates a .webloc file on user's desktop
# Notes:                      Based off the script written by Erik Berglund (https://github.com/erikberglund)
#################################################################################################################
# Acquire variables related to user
#################################################################################################################
# get currently logged in user
currentUser=$(/usr/bin/python -c 'from SystemConfiguration import SCDynamicStoreCopyConsoleUser; import sys; username = (SCDynamicStoreCopyConsoleUser(None, None, None) or [None])[0]; username = [username,""][username in [u"loginwindow", None, u""]]; sys.stdout.write(username + "\n");')
# get user's home folder
currentUserHome=$(dscl . -read /Users/$currentUser NFSHomeDirectory | cut -d " " -f 2)
###################################################################################################################
# Establish standardized local logging logic
###################################################################################################################
log_path="/var/log/company_name"
log_file="com.company_name.it.product.info.logging.log"

logMessage () {

  mkdir -p $log_path
  user=$((who -m | awk '{print $1}') 2>&1)
  date_set="$((date +%Y-%m-%d..%H:%M:%S-%z) 2>&1)"

  if [[ "$log_file" == "" ]]; then
    # write to stdout (capture by Jamf script logging)
    echo "$date_set    $user    ${0##*/}    $1"
  else
    # write local logs
    echo "$date_set    $user    ${0##*/}    $1" >> $log_path/$log_file
    # write to stdout (capture by Jamf script logging)
    echo "$date_set    $user    ${0##*/}    $1"
  fi
}
#####################################################################################
# Create /Library/.company_name/Icons/ if needed
#####################################################################################
if [[ -d /Library/.company_name/Icons/ ]]; then
  logMessage "/Library/.company_name/Icons/ already exists"
else
  # create company_name Scripts directory and set ownership & permissions
  mkdir -p /Library/.company_name/Icons/
  chown root:wheel /Library/.company_name/Icons/
  chmod 755 /Library/.company_name/Icons/
  if [[ -d /Library/.company_name/Icons/ ]]; then
    logMessage "/Library/.company_name/Icons/ created successfully"
  else
    logMessage "Failed to create /Library/.company_name/Icons/"
    logMessage "Exiting with error..."
    exit 1
  fi
fi
#####################################################################################
# Build .webloc icon
#####################################################################################
cat > "/private/var/tmp/getitproductinfo_base64" << 'EOF'

EOF

## convert /private/var/tmp/getitproductinfo_base64 to icon file
base64 -D -i "/private/var/tmp/getitproductinfo_base64" -o "/Library/.company_name/Icons/get_it_product_info.icns"
## delete temprary getitproductinfo_base64 icon encoding
rm -f "/private/var/tmp/getitproductinfo_base64"

## file verification
if [[ -f "/Library/.company_name/Icons/get_it_product_info.icns" ]]; then
  logMessage "/Library/.company_name/Icons/get_it_product_info.icns created successfully"
else
  logMessage "Failed to create /Library/.company_name/Icons/get_it_product_info.icns"
  logMessage "Exiting with error..."
exit 2
fi

#####################################################################################
# .webloc variables
#####################################################################################
# URL for the webloc
webloc_url="URL GOES HERE"
# File name for the webloc (This is the name without a file extension i.e. don't add .webloc to the name)
webloc_name="NAME OF THE ICON GOES HERE"
# Folder where the webloc should be created
webloc_folder_path="$currentUserHome/Desktop"
# Custom icon to use for the webloc
webloc_icon="/Library/.company_name/Icons/get_it_product_info.icns"
#####################################################################################
# Build .webloc
#####################################################################################

# create webloc path from script variables
webloc_path="$webloc_folder_path/$webloc_name.webloc"
# create the webloc
/usr/libexec/PlistBuddy -c "Add :URL string $webloc_url" "$webloc_path" > /dev/null 2>&1

# verify creation of $webloc_path
if [[ -f "$webloc_path" ]]; then
  logMessage "$webloc_path created successfully"
  logMessage "Setting $webloc_path icon to  $webloc_icon..."

  # set icns as icon for the webloc (fully qualifying python if user is running a non-standard version)
  /usr/bin/python - "$webloc_icon" "$webloc_path" << END
import Cocoa
import sys
Cocoa.NSWorkspace.sharedWorkspace().setIcon_forFile_options_(Cocoa.NSImage.alloc().initWithContentsOfFile_(sys.argv[1].decode('utf-8')), sys.argv[2].decode('utf-8'), 0) or sys.exit("Unable to set file icon")
END

  logMessage "Setting ownership and permissions"
  chown $currentUser "$webloc_path"
  chmod 644 "$webloc_path"
  logMessage "Script completed successfully"
  logMessage "Exiting..."
fi
#####################################################################################
# Create /Library/LaunchAgents/com.company_name.get.it.product.info.plist Launch Agent
#####################################################################################
# this will overwrite an existing version of this file -- this is intended behavior
cat > /Library/LaunchAgents/com.company_name.get.it.product.info.plist << 'EOF'
<?xml version="1.0" encoding="UTF-8"?>
<!DOCTYPE plist PUBLIC "-//Apple//DTD PLIST 1.0//EN" "http://www.apple.com/DTDs/PropertyList-1.0.dtd">
<plist version="1.0">
<dict>
	<key>Label</key>
	<string>com.company_name.get.it.product.info.plist</string>
	<key>ProgramArguments</key>
	<array>
		<string>/Library/.company_name/Scripts/CCB-099_get_it_product_info.sh</string>
	</array>
	<key>RunAtLoad</key>
	<true/>
</dict>
</plist>
EOF

logMessage "Setting permissions and ownership for /Library/LaunchAgents/com.company_name.get.it.assistance.plist"
chown root:wheel /Library/LaunchAgents/com.company_name.get.it.product.info.plist
chmod 644 /Library/LaunchAgents/com.company_name.get.it.product.info.plist
# verifications and exit with error
if [[ -f /Library/LaunchAgents/com.company_name.get.it.product.info.plist ]]; then
  logMessage "/Library/LaunchAgents/com.company_name.get.it.product.info.plist was created/modified on $(ls -alh /Library/LaunchAgents/com.company_name.get.it.product.info.plist | awk '{print $6,$7,$8}')"
else
  logMessage "Failed to create /Library/LaunchAgents/com.company_name.get.it.product.info.plist!"
  exit 3
fi
logMessage "Successfully arrived at end of script"
logMessage "Exiting..."
exit 0
#####################################################################################
# Erroneous completion
#####################################################################################
# if the script proceeds here, check recent coding changes for errors
logMessage "Erroneously arrived at end of script..."
exit 4
#####################################################################################
# Exit codes
#####################################################################################
# exit 0 == successful run
# exit 1 == failure to create /Library/.company_name/Icons/
# exit 2 == failure to create /Library/.company_name/Icons/get_it_product_info.icns
# exit 3 == failure to create /Library/LaunchAgents/com.company_name.get.it.product.info.plist
# exit 4 == arrived at end of script erroneously, check script for errors